import React from "react";
import "./rolecircle.css";

const Rolecircle = () => {
  return (
    <motion.div
    initial={{ opacity: 0, scale: 0 }}
    animate={{ opacity: 1, scale: 1 }}
    exit={{ opacity: 0, scale: 0 }}
    transition={{ duration: 0.5 }}
    className="rolling-circle"
  ></motion.div>
  );
};

export default Rolecircle;
